import React, { Component } from 'react';
import OriginalPokemons from './OriginalPokemons';
import Selected from './Selected'

export default class Pokemons extends Component {
    constructor(props){
        super(props)
        this.state = {
            pokemon: [],
            selected: false
        }
    }

    render() {
        return (
            <>
            {
                this.state.selected ? (
                    <Selected/>
                ):(
                    < OriginalPokemons pokemons={this.props.pokemons} />
                ) 
            }
            </>
        )
    }
}
